import logo from './logo.svg';
import './App.css';
import React, { PureComponent, useState } from 'react';
import { Button, Grid, TextField, Paper, Box, Typography, Icon, Drawer } from '@material-ui/core';
// import EmojiResults from "./EmojiResults";
import SideNav from './components/sideNav';
import SearchInput from "./components/SearchInput";
import { createTheme, makeStyles, ThemeProvider } from '@material-ui/core/styles';
import LargeTile from './components/largeTile';
import MediumTile from './components/mediumTile';
import SmallTile from './components/smallTile';
import HeadTile from './components/headTile';
import ReactMarkdown from 'react-markdown';
import RecentItems from './components/recentItems';
import LargeFillTile from './components/largeFillTile';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom';
import { projectList } from './components/projectList';
import Contacts from './components/contacts';
import contactList from './components/contactList.js'
import Select from 'react-select';
import Search from './components/Search.js'

import Filter from './components/filter';
// import InputLabel from '@mui/material/InputLabel';
// import MenuItem from '@mui/material/MenuItem';
// // import FormControl from '@mui/material/FormControl';
// import Select from '@mui/material/Select';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: 'lime',
  }
}));

const theme = createTheme({
  palette: {
    primary: {
      light: '#757ce8',
      main: '#353440',
      dark: '#FF7551',
      contrastText: '#808191',
    },
    secondary: {
      light: '#ff7961',
      main: '#f44336',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});

export default class App extends PureComponent {



  render() {

    const [state, setState] = React.useState({
      top: false,
      left: false,
      bottom: false,
      right: false,
    });

    const toggleDrawer = (anchor, open) => (event) => {
      if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
      }

      setState({ ...state, [anchor]: open });
    };

    const list = (anchor) => (
      <Box
        sx={{ width: anchor === 'top' || anchor === 'bottom' ? 'auto' : 250 }}
        role="presentation"
        onClick={toggleDrawer(anchor, false)}
        onKeyDown={toggleDrawer(anchor, false)}
      >
        <List>
          {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          {['All mail', 'Trash', 'Spam'].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </Box>
    );

    let width = window.innerWidth;
    if (width < 946){
      return (

        <Router>
          <div className="App">

            <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />
            <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Poppins:300,400,500,700&display=swap" />
            <header className="App-header">
            <Drawer
            anchor={anchor}
            open={state[anchor]}
            onClose={toggleDrawer(anchor, false)}
          >
            {list(anchor)}
          </Drawer>

              <Grid
                style={{marginLeft: '0px', width: '100%'}}
              className="landingContent"
                container 
                direction={'row'}
                justifyContent='flex-start'
                spacing={3}
              >
                  <ThemeProvider theme={theme}>
                  <Route exact={true} path="/">

                    <Search />

                  </Route>

                  </ThemeProvider>

              </Grid>

            </header>
          </div>
        </Router>
        );
    }else{
      return (

        <Router>
          <div className="App">
            <SideNav></SideNav>

            <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />
            <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Poppins:300,400,500,700&display=swap" />
            <header className="App-header">


              <Grid
                style={{marginLeft: '240px', width: '87%'}}
              className="landingContent"
                container 
                direction={'row'}
                justifyContent='flex-start'
                spacing={3}
              >
                  <ThemeProvider theme={theme}>
                  <Route exact={true} path="/">

                    <Search />

                  </Route>

                  </ThemeProvider>

              </Grid>

            </header>
          </div>
        </Router>
        );
    }


  }
}

const Post = ({  post }) => (
    <ThemeProvider theme={theme}>
    <Link to='/' className="routeLink"><Icon>arrow_back</Icon> Back</Link><br></br>

    <HeadTile><span className="HeadTile pageHeader" >{post.title}</span></HeadTile>
